import React from 'react';
import { NavLink } from 'react-router-dom';

const navigationItems = (props) => (
    <ul>
        <li><NavLink to={props.link}>Home</NavLink></li>
        <li><NavLink to={props.link}>Jam pads</NavLink></li>
        <li><NavLink to={props.link}>Bookings</NavLink></li>
    </ul>
);
export default navigationItems;
